    return (
        <div className="Home">
            <p id="mainHeading"><span id="l1">MONEY </span><span id="l2">MATTERS</span></p>
            <p id="heading">YOUR <span class="highlight">ESSENTIAL</span> FINANCE MANAGEMENT SYSTEM.</p>
            <p class="largeText">What we do ?</p>
